import React, { useState } from 'react';
import axios from 'axios';

function LawSearchResults() {
  const [query, setQuery] = useState('');
  const [openAiResults, setOpenAiResults] = useState([]);
  const [dbResults, setDbResults] = useState([]);

  const handleSearch = async () => {
    try {
      const [openAiRes, dbRes] = await Promise.all([
        axios.get(`/api/openai-laws?query=${encodeURIComponent(query)}`),
        axios.get(`/api/laws?query=${encodeURIComponent(query)}`)
      ]);
      setOpenAiResults(openAiRes.data);
      setDbResults(dbRes.data);
    } catch (err) {
      console.error('Search failed:', err);
    }
  };

  return (
    <div className="p-4">
      <h1 className="text-2xl font-bold mb-4">Search US Cybersecurity Laws</h1>
      <div className="mb-4">
        <input
          type="text"
          value={query}
          onChange={(e) => setQuery(e.target.value)}
          placeholder="Enter a search term"
          className="border p-2 w-full"
        />
        <button onClick={handleSearch} className="mt-2 bg-blue-500 text-white px-4 py-2 rounded">
          Search
        </button>
      </div>
      <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
        <div>
          <h2 className="text-xl font-semibold mb-2">OpenAI Suggestions</h2>
          {openAiResults.map((law, index) => (
            <div key={index} className="border p-4 mb-2 rounded bg-gray-50">
              <h3 className="font-bold">{law.title}</h3>
              <p>{law.description}</p>
            </div>
          ))}
        </div>
        <div>
          <h2 className="text-xl font-semibold mb-2">Database Results</h2>
          {dbResults.map((law) => (
            <div key={law.id} className="border p-4 mb-2 rounded">
              <h3 className="font-bold">{law.title}</h3>
              <p>{law.description}</p>
              <a href={law.url} target="_blank" rel="noopener noreferrer" className="text-blue-600 underline">
                {law.url}
              </a>
              <p className="italic text-sm">{law.citation}</p>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}

export default LawSearchResults;
